import React from 'react';
import {Switch, Route, BrowserRouter} from "react-router-dom";
import Navigation from "./components/Navigation";
import Home from "./components/Home";

function App() {
  return (
    <BrowserRouter>
        <>
          <Navigation />
          <Switch>
            <Route exact path="/" component={Home} />
          </Switch>
        </>
    </BrowserRouter>
  );
}

export default App;
